  type: "Class"
  package: "com.google.cloud.bigquery"
  summary: "Class for a BigQuery Routine entity. Objects of this class represent a routine from a different dataset to grant access to. Queries executed against that routine will have read access to views/tables/routines in this dataset. Only UDF is supported for now. The role field is not required when this field is set. If that routine is updated by any user, access to the routine needs to be granted again via an update operation."
